import React, { useState, useEffect, useContext, useRef } from 'react';
import io from 'socket.io-client';
import UserContext from '../UserContext';
import ThemeContext from '../ThemeContext';  // Import ThemeContext
import YouTube from 'react-youtube';
import './Chat.css';

let socket;

function Chat() {
  const [message, setMessage] = useState('');
  const [chat, setChat] = useState([]);
  const [youtubeURL, setYoutubeURL] = useState('');
  const [videoID, setVideoID] = useState('M7lc1UVf-VE');
  const { user } = useContext(UserContext);
  const { theme } = useContext(ThemeContext);  // Get the theme value
  const messagesEndRef = useRef(null);

  useEffect(() => {
    socket = io('http://localhost:5000');

    socket.on('previous_messages', (messages) => {
      setChat(messages);
    });

    socket.on('receive_message', (message) => {
      setChat((oldChat) => [...oldChat, message]);
    });

    socket.on('change_video', (videoID) => {
      setVideoID(videoID);
      setYoutubeURL('');
    });

    return () => {
      socket.disconnect();
    };
  }, []);

  useEffect(() => {
    if (messagesEndRef.current) {
      messagesEndRef.current.scrollIntoView({ behavior: 'smooth' });
    }
  }, [chat]);

  const sendMessage = () => {
    if (message && user) {
      const newMessage = { username: user.username, message };
      socket.emit('send_message', newMessage);
      setMessage('');
    }
  };

  const handleKeyPress = (e) => {
    if (e.key === 'Enter') {
      sendMessage();
    }
  };

  const handleVideoChange = () => {
    try {
      const videoID = new URL(youtubeURL).searchParams.get('v');
      setVideoID(videoID);
      socket.emit('change_video', videoID);
    } catch (e) {
      console.error('Invalid YouTube URL');
    }
  };

  const themeStyles = {
    backgroundColor: theme === 'day' ? '#fff' : '#2f2f2f',
    color: theme === 'day' ? '#000' : '#c0c0c0',
  };

  return (
    <div className="chat-container" style={themeStyles}>
      <div className="video-player" style={themeStyles}>
        <div className="youtube-container">
          <YouTube 
            videoId={videoID} 
            opts={{
              height: '100%',
              width: '100%',
              playerVars: {
                autoplay: 1,
              },
            }}
          />
        </div>
        {user ? (
          <div className="video-url-input" style={themeStyles}>
            <input
              type="text"
              value={youtubeURL}
              onChange={(e) => setYoutubeURL(e.target.value)}
              placeholder="Enter YouTube URL"
              style={themeStyles}
            />
            <button onClick={handleVideoChange} style={themeStyles}>Change Video</button>
          </div>
        ) : (
          <p style={themeStyles}>You can share YouTube videos once logged in.</p>
        )}
      </div>
      
      <div className="chat-section" style={themeStyles}>
        <div className="chat-messages" style={themeStyles}>
          {chat.map((msg, index) => (
            <div key={index} className="chat-message" style={themeStyles}>
              <b style={themeStyles}>{msg.username}</b>
              <p style={themeStyles}>{msg.message}</p>
            </div>
          ))}
          <div ref={messagesEndRef} />
        </div>
        <input
          type="text"
          value={message}
          onChange={(e) => setMessage(e.target.value)}
          onKeyPress={handleKeyPress}
          className="chat-input"
          style={themeStyles}
        />
        <button onClick={sendMessage} className="chat-send-button" style={themeStyles}>Send</button>
        {!user && <p style={{ color: theme === 'day' ? 'red' : 'pink' }}>Please log in to join the chat.</p>}
      </div>
    </div>
  );
}

export default Chat;
